      <text class="e4151ed5-04ac-45f1-89c8-ab6900eba567" transform="translate(205.95 200.21)">サイバースミスに<tspan x="0" y="60">できること</tspan></text>
      <text class="bc49a710-2731-4ea2-9dff-b5409a0dbdf7" transform="translate(263.18 366.29)">人と人をつなげ<tspan class="a7d40363-0925-4bcf-89cf-a3d46e5167f6" x="138.6" y="0">、</tspan><tspan x="0" y="31.5">あらゆる課題を解決し</tspan><tspan class="a7d40363-0925-4bcf-89cf-a3d46e5167f6" x="198" y="31.5">、</tspan><tspan x="0" y="63">世の中を良くするために</tspan><tspan x="0" y="94.5">活動していきます</tspan><tspan class="e243d660-d3d8-4a6b-aa0c-384514f5f009" x="158.4" y="94.5">。</tspan></text>
      <text class="a27d521b-c25b-40d1-8607-64297d84caed" transform="translate(145 1261.6)">フリーランス・コンサルタントの方々にプロジェクト案件<tspan x="0" y="35">をご紹介</tspan><tspan class="f704df63-b78d-49f3-bb01-d84655c7ee15" x="88" y="35">。</tspan><tspan x="0" y="70">アサイン後のフォローアップなど、ご登録者を支えるフォ</tspan><tspan x="0" y="105">ローが充実しているため、継続的にご活用頂いております</tspan><tspan class="f704df63-b78d-49f3-bb01-d84655c7ee15" x="572" y="105">。</tspan><tspan x="0" y="140">独自の人脈だけではつながることが難しい案件や、ステッ</tspan><tspan x="0" y="175">プアップができる案件もご紹介することが可能です</tspan><tspan class="f704df63-b78d-49f3-bb01-d84655c7ee15" x="506" y="175">。</tspan></text>
      <text class="bc49a710-2731-4ea2-9dff-b5409a0dbdf7" transform="translate(145 1885.84)">ビジネスに役立つ情報から、IT・A<tspan class="b04e525a-6a25-450a-a1c8-d8931b5d4788" x="312.26" y="0">I</tspan><tspan class="e68d39e5-5f3b-4742-b150-4397abf6f2ca" x="323.05" y="0">の活用方法まで、セミナーを開催しておりますので是非ご参加ください</tspan><tspan class="a7d40363-0925-4bcf-89cf-a3d46e5167f6" x="956.65" y="0">。</tspan><tspan x="0" y="31.5">サイバースミスでは、プロフェッショナル同士が意見交換をすることができる学びの場の開催にも取り組んでいますので</tspan><tspan class="a7d40363-0925-4bcf-89cf-a3d46e5167f6" x="1069.2" y="31.5">、</tspan><tspan x="0" y="63">新しい技術や興味のある分野など、視野を広げるお手伝いもしています</tspan><tspan class="aeae95e9-39da-477b-aa1c-f741da10f93a" x="633.6" y="63">。</tspan></text>
      <text class="ec1c959f-f408-4bfc-96ca-2b079616f473" transform="translate(143.95 1002.21)">WORK</text>
      <text class="e183702e-2d2a-4ce2-9f5c-779122299275" transform="translate(144.95 1079.21)">プロフェッショナル<tspan x="0" y="80.5">同士がつながる</tspan></text>
      <rect class="ace3a90b-7689-4ada-bc8e-d6b49981a385" x="-22" y="2150" width="1427" height="594"/>
      <text class="bc49a710-2731-4ea2-9dff-b5409a0dbdf7" transform="translate(144.41 2357.64)">小中高、大学、社会人の各年代に応じた<tspan x="0" y="31.5">実践的な教育環境の構築と、サービスの提供</tspan><tspan class="a7d40363-0925-4bcf-89cf-a3d46e5167f6" x="396" y="31.5">。</tspan><tspan x="0" y="94.5">I</tspan><tspan class="ab094d09-7f52-4726-94c5-f9cc18d3da8a" x="6.28" y="94.5">T</tspan><tspan x="24.26" y="94.5">業界を目指す学生を増やし</tspan><tspan class="a7d40363-0925-4bcf-89cf-a3d46e5167f6" x="261.86" y="94.5">、</tspan><tspan x="0" y="126">教養として</tspan><tspan class="b04e525a-6a25-450a-a1c8-d8931b5d4788" x="99" y="126">の</tspan><tspan class="e68d39e5-5f3b-4742-b150-4397abf6f2ca" x="123.3" y="126">I</tspan><tspan class="b04e525a-6a25-450a-a1c8-d8931b5d4788" x="129.58" y="126">T</tspan><tspan class="e68d39e5-5f3b-4742-b150-4397abf6f2ca" x="147.56" y="126">技術力を身につける</tspan><tspan class="a7d40363-0925-4bcf-89cf-a3d46e5167f6" x="325.76" y="126">。</tspan></text>
